---
layout: default
---
<div class="container-fluid">
	<div class="row">
		<div class="col-lg-12">
			{% if page.incomplete %} {% include incompletelist.html %} {% endif %}
			{% if page.empty %} {% include emptylist.html %} {% endif %}
			<ul>
				{% for item in page %}
				  <li>
				    <a href="https://github.com/{{ member.github }}">
				      {{ item.name }}
				    </a>
				  </li>
				{% endfor %}
			</ul>
		</div>
	</div>
</div>
